import React, { Component } from "react";
import "./List.css"

export default class List extends Component {
  render() {
      console.log(this)
    return (
        // 解构赋值，拿到props传过来的数据
        // const {todos}=this.props.todos
      <div className="listWrapper">


        <li>
          <label>
            <input type="checkbox" />
            <span>xxxxx</span>
          </label>
          <button className="btn btn-danger" style={{display:'none'}}>
            删除
          </button>
        </li>
        <li>
          <label>
            <input type="checkbox" />
            <span>yyyy</span>
          </label>
          <button className="btn btn-danger" style={{display:'none'}}>
            删除
          </button>
        </li>



      </div>
    );
  }
}
